import MealPreviwGrid from '../components/mealPreviwGrid';
import {FetchMealById} from '../services/mealtService';

function Detail() {
    const {id} = useParams([]);
    const [meal, setMeal] = useState(null)

	useEffect(() => {
		async function Data() {
			const data = await FetchMealById(id);
			setMeal(data);
		}
		Data();
	}, [id]);

	console.log(id)
	return (
		<div className='page'>
			<MealPreviwGrid />
		</div>
	);
}

export default Detail;
